        double[][] m=new double[4][4];
        for(int i=0;i<4;i++){
            for(int j=0;j<4;j++){
                m[i][j]=s.nextDouble();
            }
        }
        System.out.println("Sum of the elements in the major diagonal is "+sumMajorDiagonal(m));
    }
    public static double sumMajorDiagonal(double[][] m){
        double temp=0;
        for(int i=0;i<4;i++){
            for(int j=0;j<4;j++){
                if(i==j){
                    temp=temp+m[i][j];
                }
            }
        }
        return temp;
    }
}

